import React from 'react';
import './App.css';
import BlogMessages from './components/BlogMessages';
import { Provider } from 'react-redux';
import { store } from './actions/store';
import { Container } from "@material-ui/core";

function App() {
  return (
    <Provider store={store}>
      <Container max>
        <BlogMessages />
      </Container>
    </Provider>
  );
}

export default App;
